import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the main content elements to be available
    await page.waitForSelector('a', { timeout: 5000 });
    await page.waitForSelector('button', { timeout: 5000 });
    await page.waitForSelector('div.category-card', { timeout: 5000 });

    // 1. Exfiltrate all link texts and hrefs
    const allLinksData = await page.$$eval('a', (elements) =>
      elements.map((el) => ({
        text: el.textContent.trim(),
        href: el.getAttribute('href'),
      }))
    );

    // 2. Exfiltrate all button texts
    const allButtonTexts = await page.locator('button').allInnerTexts();

    // 3. Exfiltrate all category card texts
    const allCategoryTexts = await page.locator('div.category-card').allInnerTexts();

    // Take a screenshot after data has been gathered (no visual change expected)
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_exfiltration.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_exfiltration.png'));

    // Consolidate the extracted data
    const extractedData = {
      linkCount: allLinksData.length,
      buttonCount: allButtonTexts.length,
      categoryCount: allCategoryTexts.length,
      links: allLinksData.filter(link => link.text), // Filter out links with no visible text
      buttons: allButtonTexts.filter(text => text.trim()), // Filter out buttons with no text
      categories: allCategoryTexts,
    };

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting all links, button texts, and category information from the page.",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
